import React, { Component } from 'react'
import ContactKeepers from '../layout/ContactKeeper.png'

import AwesomeSlider from 'react-awesome-slider';
import captionStyles from 'react-awesome-slider/dist/captioned.css';
import coreStyles from '../../slider.scss';
import 'react-awesome-slider/dist/captioned.css';


class ContactKeeper extends Component {
    render() {
        return (
            <React.Fragment>
                <AwesomeSlider
                    cssModule={[captionStyles]}
                    bullets={false}
                >
                    <div>
                        <img        
                            src={ContactKeepers}
                            style={{width: '100%', height: '100%'}}
                            alt ="ContactKeeper"
                        />
                    </div>
                </AwesomeSlider>

                <div className ="text-primary text-center">        
                    This is my first full stack application created for learning the back-end. 
                    I used postman for creating my API and use MongoDB to serve as my Cloud Database
                </div>
            </React.Fragment>
        )
    }
}
export default ContactKeeper
